import{_ as t,c as a,o,ae as s}from"./chunks/framework.Dh1jimFm.js";const u=JSON.parse('{"title":"Sasto Tickets Web-Based SDK for Mobile Apps","description":"","frontmatter":{},"headers":[],"relativePath":"index.md","filePath":"index.md"}'),i={name:"index.md"};function n(r,e,h,l,d,c){return o(),a("div",null,e[0]||(e[0]=[s('<h1 id="sasto-tickets-web-based-sdk-for-mobile-apps" tabindex="-1">Sasto Tickets Web-Based SDK for Mobile Apps <a class="header-anchor" href="#sasto-tickets-web-based-sdk-for-mobile-apps" aria-label="Permalink to &quot;Sasto Tickets Web-Based SDK for Mobile Apps&quot;">​</a></h1><h2 id="introduction" tabindex="-1">Introduction <a class="header-anchor" href="#introduction" aria-label="Permalink to &quot;Introduction&quot;">​</a></h2><p>The Sasto Tickets Web-Based SDK enables seamless integration of flight booking and ticketing features into vendor applications. Designed for B2C use, the SDK simplifies the interaction by allowing vendors to manage payment and ticket issuance while we handle the core booking operations.</p><h3 id="setting-up" tabindex="-1">Setting Up: <a class="header-anchor" href="#setting-up" aria-label="Permalink to &quot;Setting Up:&quot;">​</a></h3><p>Vendors need to set up an business account with us. They will be provided with the <strong>BASE_API_URL</strong> and credentials for both UAT (User Acceptance Testing) and live environments by our Team.</p><h3 id="how-it-works" tabindex="-1">How It Works: <a class="header-anchor" href="#how-it-works" aria-label="Permalink to &quot;How It Works:&quot;">​</a></h3><h3 id="step-1-get-token" tabindex="-1">Step 1: Get Token: <a class="header-anchor" href="#step-1-get-token" aria-label="Permalink to &quot;Step 1: Get Token:&quot;">​</a></h3><p>Using the provided credentials, vendors must call our <code>get-token</code> API from their backend to obtain an access token. This token is essential for interacting with other SDK endpoints and must be passed during redirection as outlined in the documentation.</p><h3 id="step-2-rooms-booking-workflow-with-our-solution" tabindex="-1">Step 2: Rooms Booking Workflow with our Solution <a class="header-anchor" href="#step-2-rooms-booking-workflow-with-our-solution" aria-label="Permalink to &quot;Step 2: Rooms Booking Workflow with our Solution&quot;">​</a></h3><p>The Web SDK facilitates the rooms search functionality. The SDK checks the availability of selected rooms and provides detailed options for the vendor’s app.The SDK handles rooms reservation, returning booking details to the vendor.</p><h3 id="step-3-payment-vendor-s-system" tabindex="-1">Step 3: Payment (Vendor’s System) <a class="header-anchor" href="#step-3-payment-vendor-s-system" aria-label="Permalink to &quot;Step 3: Payment (Vendor’s System)&quot;">​</a></h3><p>The vendor’s app manages the payment process using the data provided by the SDK.</p><h3 id="step-4-issue-ticket" tabindex="-1">Step 4: Issue Ticket <a class="header-anchor" href="#step-4-issue-ticket" aria-label="Permalink to &quot;Step 4: Issue Ticket&quot;">​</a></h3><p>The vendor’s backend calls the <code>issue-ticket</code> API to confirm the booking and issue tickets.</p><blockquote><p><strong>Note:</strong> Step 2 is fully managed by our SDK, while other steps are handled by the vendor’s system.</p></blockquote><hr><h2 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-label="Permalink to &quot;FAQ&quot;">​</a></h2><h3 id="_1-what-is-the-sasto-tickets-b2c-sdk" tabindex="-1">1. <strong>What is the Sasto Tickets B2C SDK?</strong> <a class="header-anchor" href="#_1-what-is-the-sasto-tickets-b2c-sdk" aria-label="Permalink to &quot;1. **What is the Sasto Tickets B2C SDK?**&quot;">​</a></h3><ul><li>It is a web-based solution for integrating rooms booking and ticketing features into vendor applications.</li><li>It simplifies the process by handling rooms search, availability, and reservation workflows.</li></ul><h3 id="_2-who-manages-the-payment-process" tabindex="-1">2. <strong>Who manages the payment process?</strong> <a class="header-anchor" href="#_2-who-manages-the-payment-process" aria-label="Permalink to &quot;2. **Who manages the payment process?**&quot;">​</a></h3><ul><li>The vendor’s system is responsible for managing and securing the payment process. The SDK only facilitates the booking process and provides necessary data.</li></ul><h3 id="_3-what-parts-of-the-workflow-does-the-sdk-handle" tabindex="-1">3. <strong>What parts of the workflow does the SDK handle?</strong> <a class="header-anchor" href="#_3-what-parts-of-the-workflow-does-the-sdk-handle" aria-label="Permalink to &quot;3. **What parts of the workflow does the SDK handle?**&quot;">​</a></h3><ul><li>The SDK manages: <ul><li>Roooms Search</li><li>Availability</li><li>Reservation</li></ul></li><li>The vendor’s system handles: <ul><li>Payment</li><li>Ticket Issuance</li></ul></li></ul><h3 id="_4-can-i-customize-the-sdk-interface" tabindex="-1">4. <strong>Can I customize the SDK interface?</strong> <a class="header-anchor" href="#_4-can-i-customize-the-sdk-interface" aria-label="Permalink to &quot;4. **Can I customize the SDK interface?**&quot;">​</a></h3><ul><li>The SDK provides a standardized interface with limited customization options.</li></ul><h3 id="_5-how-are-errors-handled-in-the-sdk" tabindex="-1">5. <strong>How are errors handled in the SDK?</strong> <a class="header-anchor" href="#_5-how-are-errors-handled-in-the-sdk" aria-label="Permalink to &quot;5. **How are errors handled in the SDK?**&quot;">​</a></h3><ul><li>The SDK provides detailed error messages for any issues encountered. Vendors can use these messages to debug or provide user feedback.</li></ul><h3 id="_6-what-happens-after-booking-data-is-captured" tabindex="-1">6. <strong>What happens after booking data is captured?</strong> <a class="header-anchor" href="#_6-what-happens-after-booking-data-is-captured" aria-label="Permalink to &quot;6. **What happens after booking data is captured?**&quot;">​</a></h3><ul><li>Vendors can use the booking data to process payment and issue tickets/reservations within their own systems.</li></ul><hr><p>For further details, please refer to the comprehensive API documentation included in your onboarding package or contact our support team. <a href="mailto:sonam@sastotickets.com" target="_blank" rel="noreferrer">sonam@sastotickets.com</a></p>',31)]))}const k=t(i,[["render",n]]);export{u as __pageData,k as default};
